import React from 'react'
import Navbar from './components/navbar/navbar';

export default class App extends React.Component{
  render(){
    let Component;
    switch(window.location.pathname){
      case "/":
        Component = App
        break
      case "/about":
        Component = About
        break
      case "/others":
        Component = Others
        break
    }
    return(
      <div>
        <Navbar/>
        <Component/>
      </div>
    )
  }
}
